public func MIMEType(for ext: String) -> String? {
    for (key, exts) in basicTypes {
        if exts.contains(ext) {
            return key
        }
    }
    return nil
}

public func allKnownMIMETypes(for ext: String) -> [String] {
    var results = [String]()
    for (key, exts) in allTypes {
        if exts.contains(ext) {
            results.append(key)
        }
    }
    return results
}

